def get_instruments(
    db: Session = Depends(get_db),
    current_user: UserResponse = Depends(get_current_user)  
):
    instruments = db.query(models.Instrument).filter(models.Instrument.manager_id == current_user.id).all()
    today = dt_date.today()
    for inst in instruments:
        cal_date = inst.calibration_date
        if cal_date:
            days_until_due = (cal_date - today).days
            if days_until_due < 0:
                inst.status = "Overdue"
            elif 0 <= days_until_due <= 30:
                inst.status = "Due Soon"
            else:
                inst.status = "OK"
    db.commit()
    return instruments

def create_instrument(
    instrument: schemas.InstrumentCreate,
    db: Session = Depends(get_db),
    current_user: UserResponse = Depends(get_current_user) 
):

    count = db.query(models.Instrument).filter(
        and_(
            models.Instrument.technician == instrument.technician,
            models.Instrument.calibration_date == instrument.calibration_date
        )
    ).count()
    if count >= 2:
        raise HTTPException(status_code=400, detail="A technician cannot have more than two calibrations on the same day.")

    db_instrument = models.Instrument(**instrument.dict(), manager_id=current_user.id, status="Due Soon")
    db.add(db_instrument)
    db.commit()
    db.refresh(db_instrument)
    return schemas.InstrumentResponse.model_validate(db_instrument)

