def patch_instrument(
    instrument_id: int,
    instrument: InstrumentUpdate,
    db: Session = Depends(get_db),
    current_user: UserResponse = Depends(get_current_user)
):
    db_instrument = db.query(models.Instrument).filter(
        models.Instrument.id == instrument_id,
        models.Instrument.manager_id == current_user.id
    ).first()
    if not db_instrument:
        raise HTTPException(status_code=404, detail="Instrument not found")
    for field, value in instrument.dict(exclude_unset=True).items():
        if field != "complete_calibration":
            setattr(db_instrument, field, value)

    if instrument.complete_calibration:
        today = dt_date.today()
        freq = instrument.frequency if instrument.frequency is not None else db_instrument.frequency
        if freq:
            db_instrument.calibration_date = today + relativedelta(months=int(freq))
        else:
            db_instrument.calibration_date = today

    cal_date = db_instrument.calibration_date
    today = dt_date.today()
    if cal_date:
        days_until_due = (cal_date - today).days
        if days_until_due < 0:
            db_instrument.status = "Overdue"
        elif 0 <= days_until_due <= 30:
            db_instrument.status = "Due Soon"
        else:
            db_instrument.status = "OK"
    db.commit()
    db.refresh(db_instrument)
    return schemas.InstrumentResponse.model_validate(db_instrument)

